import React from 'react';
import './App.css';

class App extends Component() {
  constructor(props) {
    super(props);
    this.state = {
      newTodo: 'test',
      todoList: [
        { id: 1, title: '第一个代办' }
      ],
    };
  }
  return() {
    let todos = this.state.todoList.map((item, index) => {
      return <li>{item.title}</li>
    })
  }
}

export default App;
